sub new {
    my $class = shift;
    my $self = {
    };
    bless ($self, $class);
    return $self;
}

sub geodata {
  my $self = shift;
  $self->{geodata} = $_[0] if defined $_[0];
  return $self->{geodata};
}

sub geocode {
  my $self    = shift;
  my %params = @_;
	my $lat = $params{lat} if defined $params{lat};
	my $lon = $params{lon} if defined $params{lon};
	my $code = uc $params{gc} if defined $params{gc}; #Geo::Code is case insensitive
	my $geo3name = $params{geoname} if defined $params{geoname};
	if (defined $lat && defined $lon) {
	if ($geo3name) {
	  $self->ngcode($lat,$lon,$geo3name);
	} else {
	  $self->gcode($lat,$lon);
	}
	} else {
	  $self->gll($code);
	}
	  my $geodata    = $self->geodata;
	  return $self->geodata;
}

sub gcode {
  my $self        = shift;
  my ($lat,$lon) = @_;
  my $geodata = &lltodec($lat,$lon);
  return $self->geodata($geodata);
}

sub gll {
	my $self        = shift;
	my $code = shift;
	my $geodata = &dencd($code);
	return $self->geodata($geodata);
}

sub ngcode {
  my $self        = shift;
  my ($lat,$lon,$geo3name) = @_;
  my $geodata = &lltodec($lat,$lon,$geo3name);
  return $self->geodata($geodata);
}



sub nencd {
        my $decll = shift;
        my $base = Math::BigInt->new(BASEN);
        my $j=0;
        my %rems;
        my %divs;

	my $num = Math::BigInt->new($decll);
	my ($dig,$rem) = $num->bdiv($base);
 

        my $enc;
        while ($dig) {
                $rems{$j} = $rem;
                $divs{$j} = $dig;
                $j++;
		my $dec = Math::BigInt->new($decll);
		$dec->bsub($rem);  
		$dec->bdiv($base); 
		$decll = $dec;
		my $num2 = Math::BigInt->new($decll);
		($dig,$rem) = $num2->bdiv($base);
		last if $j>13;
        }
        $rems{$j} = $rem;
        $divs{$j} = $dig;
        my $maxi = 0;
        foreach (sort {$b <=> $a} keys %rems) {
                if ($enc) {
			$enc .= '-'.GEONAMETRIPLE->[$rems{$_}];
                } else {
			$enc = GEONAMETRIPLE->[$rems{$_}];
                }
                $maxi++;
        }
        return $enc;
}

sub hybrid {
        my $decll = shift;
        my $base = Math::BigInt->new(BASEN);
        my $j=0;
        my %rems;
        my %divs;

        my $num = Math::BigInt->new($decll);
        my ($dig,$rem) = $num->bdiv($base);


        my $enc;
        while ($dig) {
                $rems{$j} = $rem;
                $divs{$j} = $dig;
                $j++;
                my $dec = Math::BigInt->new($decll);
                $dec->bsub($rem);
                $dec->bdiv($base);
                $decll = $dec;
                my $num2 = Math::BigInt->new($decll);
                ($dig,$rem) = $num2->bdiv($base);
                last if $j>13;
        }
        $rems{$j} = $rem;
        $divs{$j} = $dig;
        my $maxi = 0;

	my $hy=0;

        foreach (sort {$b <=> $a} keys %rems) {
                if ($enc) {
			$hy += $rems{$_} + $rems{$_}*($base-1)*$_ ;
                } else {
                        $enc = GEONAMETRIPLE->[$rems{$_}];
                }
                $maxi++;
        }
	my $acode = &encd($hy);
	$enc .= '-' . $acode;
        return $enc;
}

sub encd {
	my $decll = shift;
        my $base = Math::BigInt->new(BASEA);
        my $j=0;
        my %rems;
        my %divs;
        my $num = Math::BigInt->new($decll);
        my ($dig,$rem) = $num->bdiv($base);
        my $enc;
        while ($dig) {
                $rems{$j} = $rem;
                $divs{$j} = $dig;
                $j++;
                my $dec = Math::BigInt->new($decll);
                $dec->bsub($rem);
                $dec->bdiv($base);
                $decll = $dec;
                my $num2 = Math::BigInt->new($decll);
                ($dig,$rem) = $num2->bdiv($base);
		last if $j>10;
        }
	$rems{$j} = $rem;
	$divs{$j} = $dig;
	foreach (sort {$b <=> $a} keys %rems) {
		if ($enc) {
                        $enc .= ''.ALPHANUMERIC->[$rems{$_}];
		} else {
			$enc = ALPHANUMERIC->[$rems{$_}];
		}
	}
	return $enc;
}


sub dencd {
        my $decll = shift;
	my %ralphabet;
	my $i=0;
	my $base;
	my @dec;
	my ($x,$y,$z) = split(/\-/,$decll);
	if ($x && $y && $z) { #triple name geocode
		$base = Math::BigInt->new(BASEN);
		@dec = ($x,$y,$z);
        	foreach (@{+GEONAMETRIPLE}) {
        	        $ralphabet{$_}=$i;
        	        $i++;
        	}
	} elsif ($x && $y) { #hybrid

	        my $j = 0;
        	my $bignum=0;

                my $basen = Math::BigInt->new(BASEN);
                foreach (@{+GEONAMETRIPLE}) {
                        $ralphabet{$_}=$i;
                        $i++;
                }
		my $valn = Math::BigInt->new($ralphabet{$x});
		$valn->bmul($basen);
		$valn->bmul($basen);
		my @dec = split(//,$y); #$y is the alphanumeric part
		$base =  Math::BigInt->new(BASEA);
		my %ralphabeta;
		$i=0;
                foreach (@{+ALPHANUMERIC}) {
                        $ralphabeta{$_}=$i;
                        $i++;
                }
		my $rem = pop @dec;
		        foreach (@dec) {
                	my $val = Math::BigInt->new($ralphabeta{$_});
                	my $big = Math::BigInt->new($bignum);
                	my $nextval = $val->badd($big);
                	$bignum =  $val->bmul($base);
                	$j++;
        	}
        	my $lastrem = Math::BigInt->new($ralphabeta{$rem});
        	$bignum = $lastrem->badd($bignum);
		$bignum = $lastrem->badd($valn);
        	my $padd = Math::BigInt->new(PADD);
        	$bignum = $padd->badd($bignum);
        	my $bigbin = sprintf ("%b", $bignum);
        	my @c = split(//,$bigbin);
        	my ($num1,$num2);
        	my $sac = $#c;
        	unless ($sac % 2) {
        	        unshift @c, '0';
        	}
        	while (@c) {
        	        my $one = shift @c;
        	        my $two = shift @c;
        	        $num1 .= $one;
        	        $num2 .= $two;
        	}
        	my $xy = oct("0b" . $num1);
        	my $yx = oct("0b" . $num2);
        	$xy -= 27000000;
        	$yx -= 27000000;
        	my $numlat = ($xy+$yx)/2;
        	my $numlon = $xy - $numlat;
        	my $lat = $numlat/100000;
        	my $lon = $numlon/100000;
        	$lat = sprintf( "%.5f", $lat );
        	$lon = sprintf( "%.5f", $lon );
        	my @point = ($lat,$lon);
        	return \@point;








	} else { #alphanumeric geocode
		@dec = split(//,$decll);
		$base =  Math::BigInt->new(BASEA);
		foreach (@{+ALPHANUMERIC}) {
			$ralphabet{$_}=$i;
			$i++;
		}
	}
	my $j = 0;
	my $bignum=0;
	my $rem = pop @dec;
	foreach (@dec) {
	        my $val = Math::BigInt->new($ralphabet{$_});
		my $big = Math::BigInt->new($bignum);
		my $nextval = $val->badd($big);
		$bignum =  $val->bmul($base); 
	        $j++;
	}
	my $lastrem = Math::BigInt->new($ralphabet{$rem});
	$bignum = $lastrem->badd($bignum);
	my $padd = Math::BigInt->new(PADD);
	$bignum = $padd->badd($bignum);
	my $bigbin = sprintf ("%b", $bignum);
	my @c = split(//,$bigbin);
	my ($num1,$num2);
	my $sac = $#c;
	unless ($sac % 2) {
		unshift @c, '0';
	}
	while (@c) {
		my $one = shift @c;
		my $two = shift @c;
		$num1 .= $one;
		$num2 .= $two;
	}
	my $xy = oct("0b" . $num1);
	my $yx = oct("0b" . $num2);
	$xy -= 27000000;
	$yx -= 27000000;
	my $numlat = ($xy+$yx)/2;
	my $numlon = $xy - $numlat;
	my $lat = $numlat/100000;
	my $lon = $numlon/100000;
        $lat = sprintf( "%.5f", $lat );
        $lon = sprintf( "%.5f", $lon );	
	my @point = ($lat,$lon);
	return \@point;
}





sub lltodec {
        my ($lat,$lon,$geoname) = @_;
	$lat = sprintf( "%.5f", $lat );
	$lon = sprintf( "%.5f", $lon );

	if ($lat<-90 || $lat>90 || $lon<-180 || $lon>180) {
		return 0;
	}

        $lat *= 100000;
        $lon *= 100000;
	my $x = Math::BigInt->new($lat); 
	my $y = Math::BigInt->new($lon);
        my $xx = Math::BigInt->new($lat);
        my $yy = Math::BigInt->new($lon);
	$x->badd($y); 
	my $xy = $x;
	$xx->bsub($yy); 
	my $yx = $xx;
        my $aa = Math::BigInt->new($xy);
        my $bb = Math::BigInt->new($yx);
	my $coef =  Math::BigInt->new('27000000'); #make sure all values are positive >=0
	$aa->badd($coef);
	$bb->badd($coef);
	$xy = $aa;
	$yx = $bb;
	my $binlat = sprintf ("%b", $xy);
	my $binlon = sprintf ("%b", $yx);
	my @a = split(//,$binlat);
	my @b = split(//,$binlon);
	my $combinedll ='';
	while (@a || @b) {
		my $b1 = pop @a;
		my $b2 = pop @b;
                $b1 = '0' unless defined $b1;
                $b2 = '0' unless defined $b2;
		$combinedll = $b1.$b2.$combinedll;
	}
	my $bigbin = Math::BigInt->from_bin($combinedll);
        my $decimal = $bigbin->bstr();
	my $decismall = Math::BigInt->new($decimal);	

        my $deciminus = Math::BigInt->new(PADD); #the minimum value of $combinedll is 282699884614999 (if lat,lon are in the range of -90..90 and -180..180) Alphanumeric Geo::Codes will range from 1000000000 in the South Pole (-90,-154.23359), to UTRC9O4N8P in the North Pole (90,23.14496)
	$decismall->bsub($deciminus);   
	$decimal = $decismall;

	my $geocode; #will return either an alphanumeric geocode, or a triple name geocode here.
	if ($geoname) {
		if ($geoname == 2) {
			$geocode = &hybrid($decimal);
		} else {
			$geocode = &nencd($decimal);
		}
	} else {
		$geocode = &encd($decimal);
	}
	return $geocode;
}



=head1 NAME

Geo::Code - The GeoCode of a latitude,longitude point is a ten byte string, three geonames, or a hybrid code. This Perl module converts between them.

=head1 VERSION

Version 1.2

=cut

our $VERSION = '1.2';


=head1 SYNOPSIS

 	use Geo::Code;
	my $g = Geo::Code->new();
	my $geocode = $g->geocode(lat=>45.900,lon=>-64.363, geoname => 1);
 
        # geoname can take one of three values => {0,1,2}. 0 -> Alphanumeric, 1 -> three geonames, 2 -> hybrid string (one geoname and a string).
                     
	# Example 1 (Alphanumeric Geo::Code)

	#!/usr/bin/perl
	use strict;
	use Geo::Code;
	my $g = Geo::Code->new();
	my $geocode = $g->geocode(lat=>45.900,lon=>-64.363, geoname => 0);

	print "The geocode is $geocode\n";

	#expected response
	The geocode is EHBSYSEIAH

        # Example 2 (Triple Name Geo::Code)

        #!/usr/bin/perl
        use strict;
        use Geo::Code;
        my $g = Geo::Code->new();
        my $geocode = $g->geocode(lat=>45.900,lon=>-64.363, geoname => 1);

        print "The geocode is $geocode\n";

        #expected response
        The geocode is MONCTON-JIJE-COAK


        # Example 3 (Hybrid Geo::Code)

        #!/usr/bin/perl
        use strict;
        use Geo::Code;
        my $g = Geo::Code->new();
        my $geocode = $g->geocode(lat=>45.900,lon=>-64.363, geoname => 2);

        print "The geocode is $geocode\n";

        #expected response
        The geocode is MONCTON-5BCIZRD


        # Example 4 (Convert a Geo::Code back to Latitude,Longitude)

        #!/usr/bin/perl
        use strict;
        use Geo::Code;
        my $g = Geo::Code->new();
	my $geocode='EHBSYSEIAH';
        my $xy = $g->geocode(gc=>$geocode);
	my ($lat,$lon) = @$xy;
        print "The latitude,longitude of $geocode is ($lat,$lon)\n";

        my $geocode='MONCTON-JIJE-COAK';
        my $xy = $g->geocode(gc=>$geocode);
        my ($lat,$lon) = @$xy;
        print "The latitude,longitude of $geocode is ($lat,$lon)\n";

        my $geocode='MONCTON-5BCIZRD';
        my $xy = $g->geocode(gc=>$geocode);
        my ($lat,$lon) = @$xy;
        print "The latitude,longitude of $geocode is ($lat,$lon)\n";


        #expected response
        The latitude,longitude of EHBSYSEIAH is (45.90000,-64.36300)
	The latitude,longitude of MONCTON-JIJE-COAK is (45.90000,-64.36300)
	The latitude,longitude of MONCTON-5BCIZRD is (45.90000,-64.36300)


=head1 DESCRIPTION

Encoding geographic coordinates into a string is a trivial thing. Yet, there are many grid based systems (geohash, PlusCodes, Mapcodes), and some even turn the thing into a business (Zippr, What3Words). I agree with the commonly stated motivation that Latitude and Longitude are not sufficient for identifying a place in both an unambiguous and human friendly way. A single string for this pair of numbers is a better representation, if only it can preserve all the information contained in the original latitude,longitude pair, something no existing geo-encoding system does. That's my goal.

Geo::Code is an open source Geolocation Code. It translates between (latitude,longitude) and three types of one dimensional string (one alphanumeric string, a triple geoname combination or a hybrid).

The Alphanumeric Geo::Code is shorter than most alternatives (10 bytes), has higher accuracy (up to 1 meters) and avoids the borderline discontinuities of other one-dimensional location codes such a geohashes and plus codes.

Triple Name Geo::Code is more human readable than alternatives because it uses actual geographic names and maintains location proximity to the latitude,longitude point, with the first geoname in the triple representing the most prominent geo name within 146.3 km of the point. No geoname is longer than 8 bytes.

The hybrid Geo::Code is composed of two parts, one geoname and an alphanumeric string. The Geoname represents the most promiment location name in the points vicinity while the alphanumeric string part indicates weather two points are far or near, based on how many significant digits they have in common.

This module is explained in more detailed on GitHub. L<View on GitHub|https://github.com/eruci/geocode>.

Online Demo. L<3Geonames.org|https://3geonames.org>.

Also supported on L<Geocode.xyz|https://geocode.xyz>.

